import { Component, Inject, LOCALE_ID, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { TranslateService } from '@ngx-translate/core';
import { ToastrService } from 'ngx-toastr';
import { ContinuousImprovement } from './continuous-improvement.model';
import { ContinuousImprovementService } from './continuous-improvement.service';
import { NgxSpinnerService } from "ngx-spinner";
import { DateHelp } from 'src/app/_helpers/date-helper';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
import { formatDate } from '@angular/common';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-continuous-improvement',
  templateUrl: './continuous-improvement.component.html',
  styleUrls: ['./continuous-improvement.component.css']
})
export class ContinuousImprovementComponent implements OnInit {

  registerContinuousImprovementForm: FormGroup;
  submitted = false; //identifica el estado del formulario
  submittedUp = false; //auxiliar - identifica el estado del formulario
  mode = '' ; // identifica el modo de transaccion del componente: CREATE , UPDATE
  selectedContImprovementId // Id del registro seleccionado
  selectedSoFolderId;
  continuousImprovement: ContinuousImprovement;
  today: any;
  timeLocale:any;

  param8 = {value: '8'};
  param100 = {value: '100'};
  param200 = {value: '200'};
  param500 = {value: '500'};
  param10000 = {value: '10000'};

  get f() {
    return this.registerContinuousImprovementForm.controls;
  }

  constructor(private formBuilder: FormBuilder, private router: Router,
              private activatedRoute: ActivatedRoute, public continuousImprovementsService: ContinuousImprovementService,
              private toastr: ToastrService, private translate: TranslateService, private spinner: NgxSpinnerService,
              private dateHelp: DateHelp,  @Inject(LOCALE_ID) locale: string) {

              this.spinner.show();
              this.activatedRoute.params.subscribe(params => {
                this.selectedSoFolderId = params.idF;//en creacion es diferente de nulo / en edicion es nulo
                this.selectedContImprovementId = params.id; // en creacion es nulo / en edición es diferencte de nulo
                if (this.selectedContImprovementId === undefined || this.selectedContImprovementId == null) {
                  this.mode = 'CREATE';
                  this.spinner.hide();
                } else {
                  this.mode = 'UPDATE';
                  this.getContImprovement(this.selectedContImprovementId);
                }
              });

              this.timeLocale = locale;
  }

  ngOnInit(): void {

    this.today = this.dateHelp.maxDateToday;

    this.registerContinuousImprovementForm = this.formBuilder.group({
      id: [],
      accionesPropuestas: ["", [Validators.required, Validators.maxLength(10000)]],
      accionesControl: ["", [Validators.required, Validators.maxLength(10000)]],
      otrasAcciones: ["", [Validators.required, Validators.maxLength(10000)]],
      accionId: ["", [Validators.required, Validators.maxLength(100)]],
      motivacion: ["", [Validators.required, Validators.maxLength(10000)]],
      objetivoEstr: ["", [Validators.required, Validators.maxLength(200)]],
      responsable: ["", [Validators.required, Validators.maxLength(200)]],
      resultadoEvaluacion: ["", [Validators.required, Validators.maxLength(10000)]],
      carpeta: [null],
    });

  }

  getContImprovement(id) {
    this.continuousImprovementsService.getContImprovementById(id).subscribe((res: any) => {
      this.continuousImprovement = res;
      this.registerContinuousImprovementForm.patchValue(res);
      this.spinner.hide();
    },
    err => {
      this.spinner.hide();
      this.toastr.error(`Error, ${err.error.message}`);
    });
  }

  onSubmit() {
    this.submitted = true;
    if (this.registerContinuousImprovementForm.invalid) {
      return;
    }
    this.submittedUp = true;

    this.continuousImprovement = this.registerContinuousImprovementForm.value;
    this.continuousImprovement.carpeta = this.selectedSoFolderId;
    this.onCreateContImprovement();
  }

  onCreateContImprovement() {
    this.spinner.show();
    if (this.mode === 'CREATE') {
      this.continuousImprovementsService.registerContImprovement(this.continuousImprovement).subscribe((res: any) => {
          this.continuousImprovement = res;
          this.spinner.hide();
          this.translate.get('success_create_update').subscribe((res: string) => {
            this.toastr.success(res);
          });
          this.mode = 'UPDATE';
          this.onSaveContinuousImprovement(this.continuousImprovement.id);
        },
        err => {
          this.spinner.hide();
          this.toastr.error(`Error, ${err.error.message}`);
          this.submittedUp = false;
        },
        () => { }
      );
    } else if (this.mode === 'UPDATE') {
      this.continuousImprovementsService.updateContImprovement(this.continuousImprovement, this.selectedContImprovementId).subscribe((res: any) => {
        this.continuousImprovement = res;
        this.spinner.hide();
        this.translate.get('success_create_update').subscribe((res: string) => {
          this.toastr.success(res);
        });
        this.submittedUp = false;
      },
        err => {
          this.spinner.hide();
          this.toastr.error(`Error, ${err.error.message}`);
          this.submittedUp = false;
        },
        () => { }
      );
    }
  }

  //redireccionar al estado de edición
  onSaveContinuousImprovement(id) {
    this.router.navigate([`./app/continuous-improvement/${id}`]);
  }

  onCancel() {
    this.submitted = false;
    this.registerContinuousImprovementForm.reset();
    if (this.mode === 'UPDATE') {
      this.getContImprovement(this.selectedContImprovementId);
    }
  }

  //previene que en los campos se incluyan caracteres diferentes a los numericos
  keyPress(event: KeyboardEvent) {
    const pattern = /[0-9]/;
    if (!pattern.test(event.key)) {    
      // invalida el caracter señalado y evita la entrada del mismo en el campo
      event.preventDefault();
    }
  }

  onDownloadContImprovement(){
    const documentDefinition = this.buildingPDFContImprovement();
    
    pdfMake.fonts = {
      Arial: { 
        normal: 'Arial.ttf',
        bold: 'Arialbd.ttf',
        italics: 'Ariali.ttf',
        bolditalics: 'Arialbi.ttf'
      }
    }
    pdfMake.createPdf(documentDefinition).open();
  }

  buildingPDFContImprovement(){
    var facultad_acta, sistemas_acta, acreditacion_acta, mejoramiento, id_accion, responsable, objetivo_estrategico,motivacion, acciones_prop,
    resultados, otras_acciones, acciones_control, fecha;
    
    this.translate.get('main.facultad_acta').subscribe((res: string) => {
      facultad_acta = res;
    });
    
    this.translate.get('main.sistemas_acta').subscribe((res: string) => {
      sistemas_acta = res;
    });
    
    this.translate.get('main.acreditacion_acta').subscribe((res: string) => {
      acreditacion_acta = res;
    });

    this.translate.get('main.mejoramiento').subscribe((res: string) => {
      mejoramiento = res;
    });

    this.translate.get('carpeta_so.id_accion').subscribe((res: string) => {
      id_accion = res;
    });

    this.translate.get('carpeta_so.responsable').subscribe((res: string) => {
      responsable = res;
    });

    this.translate.get('carpeta_so.objetivo_estrategico').subscribe((res: string) => {
      objetivo_estrategico = res;
    });

    this.translate.get('carpeta_so.motivacion').subscribe((res: string) => {
      motivacion = res;
    });

    this.translate.get('carpeta_so.acciones_prop').subscribe((res: string) => {
      acciones_prop = res;
    });

    this.translate.get('carpeta_so.resultados').subscribe((res: string) => {
      resultados = res;
    });

    this.translate.get('carpeta_so.otras_acciones').subscribe((res: string) => {
      otras_acciones = res;
    });

    this.translate.get('carpeta_so.acciones_control').subscribe((res: string) => {
      acciones_control = res;
    });
    
    this.translate.get('main.fecha').subscribe((res: string) => {
      fecha = res;
    });
    var hoy = formatDate(this.today, 'dd/MM/yyyy', this.timeLocale);
    
    return{
      pageMargins: [ 40, 155, 40, 60 ],
      header:function(currentPage, pageCount, pageSize){
        return [
          {
            margin: [40, 35, 40, 20],
            columns:[
              //imagen de cabecera
              {
                image: 'data:image/png;base64,',
                width: 95
              },
              {
                table:{
                  widths:[300,'*'],
                  body:[
                    [
                      // {text: 'pruebaa', style: 'header', alignment: 'center', rowSpan: 3},
                      {text: 'UNIVERSIDAD DE CARTAGENA', style: 'header', alignment: 'center', fontSize: 14}, 
                      {text: fecha + ': ' + hoy, style: 'infoheader', margin: [0, 8, 0, 0]}
                    ],
                    [
                      // {},
                      {text: facultad_acta + '\n' + sistemas_acta + '\n' + acreditacion_acta, style: 'header', alignment: 'center', fontSize: 12}, 
                      {text: 'VERSIÓN: 01', style: 'infoheader', margin: [0, 14, 0, 0]}
                    ],
                    [
                      // {},
                      {text: mejoramiento, style: 'header', alignment: 'center', fontSize: 12}, 
                      {text: 'PÁGINA: ' + currentPage, style: 'infoheader', margin: [0, 10, 0, 0]}              
                    ]
                  ]
                }
              }
            ]
          }
        ]
      },
      content: [
        {
          fontSize: 11,
          table:{
            widths:['*','*','*','*'],
              body:[
                [
                  {text: mejoramiento, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  {text: id_accion, style: 'subHeader'},
                  {text: this.continuousImprovement.accionId},
                  {text: responsable, style: 'subHeader'},
                  {text: this.continuousImprovement.responsable}
                ],
                [
                  {text: motivacion, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  //contenido de motivacion
                  {text: this.continuousImprovement.motivacion, colSpan: 4 },{},{},{}
                ],
                [
                  {text: acciones_prop, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  //contenido de acciones
                  {text: this.continuousImprovement.accionesPropuestas, colSpan: 4 },{},{},{}
                ],
                [
                  {text: resultados, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  //contenido de resultados
                  {text: this.continuousImprovement.resultadoEvaluacion, colSpan: 4 },{},{},{}
                ],
                [
                  {text: otras_acciones, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  //contenido de acciones de control
                  {text: this.continuousImprovement.otrasAcciones, colSpan: 4 },{},{},{}
                ],
                [
                  {text: acciones_control, colSpan: 4, style: 'subHeader'},{},{},{}
                ],
                [
                  //contenido de vigilancia
                  {text: this.continuousImprovement.accionesControl, colSpan: 4 },{},{},{}
                ]
              ]
          }
        }
      ],
      defaultStyle: {
        font: 'Arial'
      },
      styles:{
        header: {
          bold: true,
        },
        infoheader:{
          fontSize: 8,
          bold: true,
          alignment: 'left'
        },
        subHeader:{
          bold: true,
          alignment: 'center'
        }
      }
    }
  }

}